import Prismic from '@prismicio/client'

const apiEndpoint = 'https://testecalendario.prismic.io/api/v2'
export const client = Prismic.client(apiEndpoint)

const response = await client.query(
    Prismic.Predicates.at('document.type', 'blog_spot'),
    {orderings: '[my.blog_post.data desc]' }
)
if(response){
    console.log("AQUI")
    console.log(response)
}
